import React, { useState } from 'react';
import './style.css';

const ContactUs = () => {
  const [faq, setFaq] = useState([
    { question: '1. Bagaimana sejarah singkat Pulau Seribu?', answer: 'Pulau Seribu telah dihuni sejak zaman prasejarah oleh suku pesisir seperti suku Betawi dan suku Jawa. Pulau-pulau ini memiliki peran penting dalam sejarah maritim dan perdagangan di wilayah Jakarta. Pada akhir abad ke-20, Pulau Seribu mulai dikembangkan sebagai tujuan wisata. Pemerintah dan pengusaha pariwisata mengenali potensi alaminya yang indah, dengan pantai berpasir putih, terumbu karang, dan kehidupan laut yang kaya. Pulau-pulau ini menjadi populer sebagai tempat liburan dan penyelaman.', isOpen: false },
    { question: '2. Siapakah yang mengelola wisata Pulau Seribu?', answer: 'Wisata Pulau Seribu dikelola oleh berbagai pihak, termasuk pemerintah dan sektor swasta. Di antaranya, pemerintah daerah, dinas pariwisata, perusahaan pariwisata, komunitas lokal, dan organisasi lingkungan.', isOpen: false },
    { question: '3. Apakah ada fasilitas akomodasi di Pulau Seribu?', answer: 'Jawaban 3', isOpen: false },
    { question: '4. Kapan waktu terbaik untuk mengunjungi Pulau Seribu?', answer: 'Jawaban 4', isOpen: false },
    { question: '5. Apakah ada peraturan khusus yang harus diikuti saat berkunjung ke Pulau Seribu?', answer: 'Jawaban 5', isOpen: false },
  ]);

  const toggleFAQ = (index) => {
    setFaq((prevState) => {
      const updatedFaq = prevState.map((item, i) => {
        if (i === index) {
          return {
            ...item,
            isOpen: !item.isOpen
          };
        }
        return item;
      });
      return updatedFaq;
    });
  };

  return (
    <div>
      <div className="bg-red 100% flex mt-36">
        <div className="w-3/4 pr-8">
          <h2 className="text-2xl font-bold mb-4">FAQ</h2>
          {faq.map((item, index) => (
  <div key={index} className="mb-4 border border-gray-300 rounded p-4">
    <div className="flex items-center">
      <button
        className="mr-2 text-blue-500"
        onClick={() => toggleFAQ(index)}
      >
        {item.isOpen ? '-' : '+'}
      </button>
      <p className="font-semibold">{item.question}</p>
    </div>
    {item.isOpen && <p>{item.answer}</p>}
  </div>
))}

        </div>

        <div className="w-1/4">
          <h2 className="text-2xl font-bold mb-4">Our Contact</h2>
          <div className="mb-4">
            <h3 className="text-lg font-bold">Abdul</h3>
            <div className="flex items-center mb-2">
              <img src="icon-wa.png" alt="WhatsApp" className="w-6 h-6 mr-2" />
              <p>+1234567890</p>
            </div>
            <div className="flex items-center mb-2">
              <img src="icon-instagram.png" alt="Instagram" className="w-6 h-6 mr-2" />
              <p>@abdul123</p>
            </div>
            <div className="flex items-center mb-2">
              <img src="icon-linkedin.png" alt="LinkedIn" className="w-6 h-6 mr-2" />
              <p>linkedin.com/in/abdul123</p>
            </div>
          </div>
          <div>
            <h3 className="text-lg font-bold">Budi</h3>
            <div className="flex items-center mb-2">
              <img src="icon-wa.png" alt="WhatsApp" className="w-6 h-6 mr-2" />
              <p>+9876543210</p>
            </div>
            <div className="flex items-center mb-2">
              <img src="icon-instagram.png" alt="Instagram" className="w-6 h-6 mr-2" />
              <p>@budi456</p>
            </div>
            <div className="flex items-center mb-2">
              <img src="icon-linkedin.png" alt="LinkedIn" className="w-6 h-6 mr-2" />
              <p>linkedin.com/in/budi456</p>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default ContactUs;
